import { Navigate } from "react-router-dom";
import { supabase } from "../../supabaseClient";

export default function RotaProtegida({ children }) {
  const usuario = supabase.auth.getUser(); // async, veja nota abaixo

  if (!usuario) {
    return <Navigate to="/" />;
  }

  return children;
}
